LÔILÔI BREAKFAST CLUB - AN EXTENSION OF MY HEART AND SOUL 💙

The team has been working tirelessly this past month to bring our event to life and I am so excited to finally share with y’all more details!!! Swipe through to read more. 🥹🖤

We cannot wait to celebrate Tết Trung Thu/Mid-Autumn Festival with you in Los Angeles on Saturday, September 30th from 11AM to 5PM! 

We can’t wait to see you. We can’t wait to welcome you home. 🫶🏼

Link to purchase tickets and exclusive merch is in our bio ♥︎ 

